(0, 667, 13, 'La ubicación está incorrecta.\r\n', '2024-03-07 17:20:47'),
(0, 765, 1, 'El socio requiere  que se le entreguen 3 códigos Qr.\r\nY 3 Rompetraficos.\r\nSe le mojones código  que tenia, le visitó  un compañero  de la Cooperativa  hace un mes y medio,  quedo en llevarle los códigos,  pero hasta la fecha no le han entregado. \r\n\r\nTambién requiere que se le comparta por WhatsApp  el código. Al 0991548764', '2024-03-07 17:52:35'),
(0, 819, 1, 'La socia, tenia previsto  realizar la actualización  de datos mediante la plataforma  teams que realizamos normalmente. \r\nPero después decidió  acercarse personalmente  a ls oficinas a realizar  la actualización.', '2024-03-07 17:58:06'),
(0, 819, 1, 'La socia, tenia previsto  realizar la actualización  de datos mediante la plataforma  teams que realizamos normalmente. \r\nPero después decidió  acercarse personalmente  a ls oficinas a realizar  la actualización.', '2024-03-07 17:58:10'),
(0, 767, 5, 'Socia quedó pendiente finalizar el registro en la aplicación JA pagos', '2024-03-07 17:59:34'),
(0, 820, 1, 'La socia, procedía a realizar la actualización  de datos mediante  la plataforma  teams, pero decidió realizar  personalmente  en las oficinas  de la Cooperativa. ', '2024-03-07 18:09:08'),
(0, 822, 1, 'La socia pide que por favor  le entreguen el código  y el romtraficos, en el lugar de trabajo de ella, ubicado en las calles \r\nVicente Pacheco y Antonio  Ricaurte, sector 5 esquina.\r\nDe la Parroquia  Ricaurte \r\nen el local llamado su Disfraz.\r\n(Alquier de ropa para disfraz)\r\n', '2024-03-07 18:22:19'),
(0, 821, 1, 'El socio, ya tiene afiliado para el servicio  del botón  de pagos, para su negocio. \r\nPero no dispone del del botón,  se le a perdido, \r\n', '2024-03-07 18:24:18'),
(0, 824, 1, 'El Ing, Javier Barbecho es el gerente de la Distribuidora de Cosmeticos del Austro, anteriormente  los compañeros  se la Cooperativa  ya le había  visitado, para que realice una apertura  de cuenta en la Cooperativa, pero, ya no habían regresado por el lugar, el señor no sabía los requisitos  para aperturar la cuenta devpersona jurídica.\r\nSe le proporciono los requisitos  para apertura  tal cuenta.\r\nPor que el señor  si esta interesado en la apertura  y en la colocación  de botones  en su Distribuidora. \r\nSe les pide dar seguimiento  a La misma.\r\n', '2024-03-07 18:46:39'),
(0, 823, 1, 'Se les hizo una visita a la Cooperativa  de Taxis Taxista.\r\nLos señores son socios de la Cooperativa   también  tienen créditos realizados  en la Cooperativa Jardín Azuayo. \r\nSe les dio a conocer  a su directivos como son: El señor Gerente,  el señor Presidente de la Compañía, los beneficios  de colocar el botón  de pagos  en cada una de sus unidades. \r\nMencionaron  que van a tratar este tema  en la reunión  de Directivos,  que tienen.\r\nPor.lo tanto el señor  Gerente, manifestó que cualquier  información, comunicarse con el señor  Presidente Bernardo Piedra con número  de celular  0994556825.\r\nSe ruega dar seguimiento  al mismo.', '2024-03-07 18:54:26'),
(0, 680, 13, 'El perfil del socio se encuentra en proceso se intentó cambiar la contraseña para solucionar pero no encontramos el correo con la clave temporal\r\n\r\nPor favor al promotor encargado del comercio acercarse ', '2024-03-07 18:57:28'),
(0, 680, 13, 'El perfil del socio se encuentra en proceso se intentó cambiar la contraseña para solucionar pero no encontramos el correo con la clave temporal\r\n\r\nPor favor al promotor encargado del comercio acercarse ', '2024-03-07 18:57:28'),
(0, 680, 1, 'Buenas noches, revise el estado de cambio\r\nY me salio bloqueado  por intentos fallidos.\r\nMe.parece que hay que resetear desde el sistema. \r\n', '2024-03-07 19:02:08'),
