(0, 858, 1, 'El socios, tiene ya realizado la afiliación,  pero cuenta con el botón de pagos.\r\nNi tampoco  el rompetraficos.\r\nComenta que hace mucho tiempo, le estaban yendo a colocar, pero, presentó algún inconveniente  con el botón.\r\nY le dijeron que tenia que acercarse  a la Oficina  de Totoracocha,  pero el socio nunca fue , por que no tiene tiempo.\r\nSe pide revisar este caso.', '2024-03-08 20:40:19'),
